// SPDX-License-Identifier: MIT
pragma solidity ^0.8.4;
import "@openzeppelin/contracts/utils/Counters.sol";
import "@openzeppelin/contracts/token/ERC721/ERC721.sol";
import "@openzeppelin/contracts/security/ReentrancyGuard.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "./interfaces/IGolToken.sol";
import "./interfaces/INonFungiblePlayer.sol";

contract Fusion is Ownable {
    uint256 public fusionFee;

    IGolToken private golToken;
    INonFungiblePlayer private nonFungiblePlayer;
    address private ownerAddr;

    event fusionSucceed(uint256 indexed tokenId);

    constructor(
        IGolToken _golToken,
        INonFungiblePlayer _nonFungiblePlayer,
        address _ownerAddr
    ) {
        fusionFee = 100;
        golToken = _golToken;
        nonFungiblePlayer = _nonFungiblePlayer;
        ownerAddr = _ownerAddr;
    }

    function setOwnerAddr(address _ownerAddr) public onlyOwner {
        ownerAddr = _ownerAddr;
    }

    function setFusionFee(uint256 _fusionFee) public onlyOwner {
        fusionFee = _fusionFee;
    }

    function _rand(uint256 _modulus) internal view returns (uint256) {
        return
            uint256(keccak256(abi.encodePacked(block.timestamp, msg.sender))) %
            _modulus;
    }

    function fusionNFPs(uint256 _tokenId1, uint256 _tokenId2) public {
        require(
            msg.sender == nonFungiblePlayer.ownerOf(_tokenId1) &&
                msg.sender == nonFungiblePlayer.ownerOf(_tokenId2),
            "You are not owner of NFPs"
        );

        require(
            golToken.balanceOf(msg.sender) >= fusionFee * 10**18,
            "Insufficient balance of Gol Token to Fusion!"
        );

        require(_tokenId1 != _tokenId2, "Token Ids of NFP must be different!");

        string memory class1 = nonFungiblePlayer.getClass(_tokenId1);
        string memory class2 = nonFungiblePlayer.getClass(_tokenId2);
        string memory position1 = nonFungiblePlayer.getPosition(_tokenId1);
        string memory position2 = nonFungiblePlayer.getPosition(_tokenId2);
        uint256 _gen1 = nonFungiblePlayer.getGeneration(_tokenId1);
        uint256 _gen2 = nonFungiblePlayer.getGeneration(_tokenId2);

        require(
            nonFungiblePlayer.getLevel(_tokenId1) == (_gen1 + 1) * 10 - 1 &&
                nonFungiblePlayer.getLevel(_tokenId2) == (_gen2 + 1) * 10 - 1,
            "Max Level required for fusion"
        );

        require(
            keccak256(abi.encodePacked(class1)) ==
                keccak256(abi.encodePacked(class2)) &&
                keccak256(abi.encodePacked(position1)) ==
                keccak256(abi.encodePacked(position2)) &&
                _gen1 == _gen2,
            "Class or Position or Generations are not same!"
        );

        golToken.transferFrom(msg.sender, ownerAddr, fusionFee * 10**18);

        string memory rarityOfNew;
        uint256 randProbability = _rand(10000);

        if (randProbability > 5500) {
            rarityOfNew = "Common";
        } else if (randProbability > 2000) {
            rarityOfNew = "Uncommon";
        } else if (randProbability > 500) {
            rarityOfNew = "Rare";
        } else if (randProbability > 100) {
            rarityOfNew = "Legendary";
        } else {
            rarityOfNew = "Mythical";
        }

        uint256 newTokenId = nonFungiblePlayer.mintFusionedNFP(
            msg.sender,
            _tokenId1,
            _tokenId2,
            position1,
            rarityOfNew,
            class1
        );

        nonFungiblePlayer.burn(_tokenId1);
        nonFungiblePlayer.burn(_tokenId2);

        emit fusionSucceed(newTokenId);
    }
}
